import React, { useState } from 'react';
import "./index.css"

const HRLoginForm = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Logic to handle HR login
  };

  return (
    <form onSubmit={handleSubmit} className='col-12 col-sm-4 background'>
      <div className="form-group m-1">
        <label htmlFor="hrEmail">Username</label>
        <input
          type="username"
          className="form-control"
          id="hrEmail"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
        />
      </div>
      <div className="form-group m-1 ">
        <label htmlFor="hrPassword">Password</label>
        <input
          type="password"
          className="form-control"
          id="hrPassword"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
      </div>
      <button type="submit" className="btn btn-primary m-1">Login</button>
    </form>
  );
};

export default HRLoginForm;
